import styled from 'styled-components';

export const Container = styled.div`

/* background-color: rgb(243, 241, 241); */
background-color: aqua;
display: flex;
flex-direction: column;
align-items: center;
width: 100%;
#myCart{
    display: flex;
    height: auto;
    flex-direction: column;
    align-items: stretch;
    width: 50%;
    background-color: red;
}
h1 {
    margin-top: 2%;
    min-width: 100%;
    text-align: center;
    margin-left: 2%;
}
.productList{
    width: 70%;
    padding-left: 0%;
}
`;
